import React from 'react';
import { connect } from 'react-redux';
import { fetchLastReservations, fetchReservations } from '../../../store/actions/reservationActions';
import './NewReservationNotif.css'

class NewReservationNotif extends React.Component {

    componentDidMount() {
        this.props.fetchLastReservations();
        this.props.fetchReservations();
    }


    render() {
        const { lastReservation, reservation } = this.props;
        console.log(lastReservation, reservation)
        const listItems = reservation.map((res) =>
        <li>
            {res}
        </li>
        )


        return (
            <div>
                {listItems}
            </div>
        )
    }
}
const mapStateToProps = state => ({
    lastReservation: state.reservations.lastReservation,
    reservation: state.reservations.reservation
});


export default connect(mapStateToProps,{ fetchLastReservations, fetchReservations })(NewReservationNotif)
